import Login from './Views/Login/login'
import {useSelector} from 'react-redux'
import ViewBugPage from './Views/Pages/viewBugs'
function App() {
  const{auth} = useSelector(state=> state)
  return (
    <>
    {!auth.LoggedIn ? <Login /> : 
      <>
        <ViewBugPage />
      </>
    }
    </>
  );
}

export default App;
